import AwWidget from 'viewmodel/AwWidgetViewModel';

/**
 * render function for AwCheckboxList
 * @deprecated afx@4.2.0.
 * @alternative AwWidget with Checkbox List LOV, reference ListLOVExampleService.js
 * @obsoleteIn afx@5.1.0
 * @returns {JSX.Element} react component
 */
export const awCheckboxListRenderFunction = ( props ) => {
    const {
        viewModel,
        ctxMin,
        actions,
        i18n,
        fields,
        grids,
        formProp,
        messages,
        ...prop
    } = props;

    return <AwWidget {...prop} />;
};
